export function ShowContainer() {
  const router = useRouter();

  console.log(router.query.bookContainer);

  useEffect(() => {
    async function fetch(router) {
      getContainer();
    }
  });

  return (
    <div className={styles.wrapper}>
      <p>{}</p>
      <p>{}</p>
    </div>
  );
}
